import React from "react";
import { Stage, Sprite } from "@inlet/react-pixi";

function PixiExam() {
  <Stage>
    <Sprite image="../static/images/puppy.png" x={100} y={100} />
  </Stage>;

  return (
    <div>
      <img src="../static/images/puppy.png"></img>
    </div>
  );
}

export default PixiExam;
